import React from 'react';

const Map = () => {
  return (
    <div>
      <iframe
        title="Mapa de Localização" // Adicionando o título aqui
        src="https://www.google.com/maps/embed?pb=your-google-maps-embed-url"
        width="600"
        height="450"
        style={{ border: 0 }}
        allowFullScreen=""
        loading="lazy"
      ></iframe>
    </div>
  );
};

export default Map;
